import { scrapThought } from "./thought";
export const splitThoughtTotalNumber = ($) => {
    const number = scrapThought($)
        .replace(/[a-z]+|\:|-\\n|[!@#\\$%\\^\\&*\\)\\(+=._-]/gim, "")
        .replace(/\s+/gim, " ")
        .split(" ")
        .filter(e => e)
        .pop();
    return Number(number);
};
